Description:
[Notitieboekje: 13 pagina's en 1 los blad]: [blad, ongepagineerd] BM edities CONTRASTO, 1495, 1525, 1628; [blad, gepagineerd 1-3] Charles de TOLNAY, Pierre Bruegel l'ancien, Bruxelles 1935, citaten pp. 25-27, 78; [blad 3, verso] [toegevoegde vermelding]: 'F.G. [...];
[blad 5, ongepagineerd,6, = p. ii]  G. Glück, Darstellungen des Karnevals und der Fasten von Bosch und Bruegel. In: Gedenkboek A. Vermeylen, 's-Gravenhage (1932), pp. 263-268, citaten; 
[blad 7, ongepagineerd] Contrasto di carnesciale et della quaresima, woodcut, repr. in F. Hermann, La vita nelle vecchie stampe italiane, Spoleta [Argentieri], 1928, p. 31; 
[blad 8, ongepagineerd] Gesamtkatalog der Wiegendrucke, VII, Leizig 1938, cols. 33-34; [toegevoegde vermelding]: 'F.G. Hans Wurst-Pekelharing, Fasching-Fasten, Fette küche-Magere Küche [...]'; 
[blad 9, ongepagineerd] R. van Bastelaer & G. Hulin de Loo, Peter Bruegel l'ancien, Bruxelles [Oest],1905-1907, citaten pp. 101-106; 
[blad 10- 11, ongepagineerd] Italienisch: Il Carnavale maskulin, La Caresmine feminin: ebenso auf Bruegel's Wiener Bild [...];
[los blad] Excès verjagt Pauvreté, GOEBEL, Wandteppiche. I. Niederlande/2, Tafelband Abb. 232; 
[blad 12-13, ongepagineerd] H. [Heinrich] GOEBEL [Göbel], Wandteppiche, I. Niederlände, [Leipzig: Klinkhardt & Biermann], (I. Text, 2 Tafeln), 1923, citaten I, pp. 89-90, 280, II. 232: Excès verjagt 'Pauvreté';
[blad 13, ongepagineerd] Ad [Addendum] Banquet Teppiche in Nancy: Pierre Boyé, Le Butin de Nancy, in: Mémoire de la Soc. d'Arch. lorraine et du musée hist. lorrian, LIV (4e série, 4e vol.) 1904, p. 125 ff: hier auch über Miniaturen die das Thema behandelen [...][scan]
